    ProfileVector,
    RateVector,
    CameraVector,
    BookVector,
} from './vectors';

export interface IconsProps {

}

const Icons: FC<IconsProps> = () => {
    return (
        <div className={styles.container}>
            <UpVector className={styles.icon} />
            <DownVector />
            <CheckVector />
            <ProfileVector />
            {/* <RateVector />
